INSERT INTO `nb_classes` VALUES (48,'CL','Процессор','Начального уровня','Самые дешевые и низкопроизводительные процессоры, включая энергосберегающие серерии. \nIntel Celeron или Pentium Silver серии N (ядро процессора Atom)\n или AMD Athlon 3020e и подобные','CPU_Бюджет'),(49,'CL','Процессор','Стандартный мобильный','Основные семейства процессоров для ноутбуков:\nIntel Core, AMD Ryzen. Модели с индексом U.\nА также ARM-чипы Apple Silicon M1, Qualcomm Snapdragon 8</ul>','CPU_Стандарт'),(50,'CL','Процессор','Для продвинутых ноутбуков','Старшие процессоры для ноутбуков:\n Intel Core, AMD Ryzen. Модели с индексом H. \nРассчитанны на использование в моделях с дискретной графикой.','CPU_Мощный'),(51,'CL','Графика','Встроенная','Только встроенная (интегрированная) в процессор графика. \nДля хранения грфических данных используется область основной оператитвной памяти.','GPU_Встроенный'),(52,'CL','Графика','Легкая внешняя','Дискретная (внешняя) видеокарта начального уровня с собственной видеопамятью\nСерии<ul><li>NVidia MX</li><li>Intel Xe 11</li><li>Radeon R/RX, 500, 600.</li></ul>','GPU_Вн_лайт'),(53,'CL','Графика','Игровая или профессиональная','Видеокарта игрового класса среднего или высокого уровня с собственной видеопамятью большого объема\n<strong>Среднего уровня:</strong><ul><li>Nvidia GTX</li><li>AMD RX5500</li></ul>\n<strong>Высокого уровня:</strong><ul><li>Nvidia RTX</li><li>AMD Radeon RX6700/6800, RX5700/5600</li></ul>\nПрофессиональные: <ul><li>Nvidia Quadro</li><li>RTX3000/RTX5000/RTX A</li><li>AMD Radeon Pro</li></ul>','GPU_Внеш_топ'),(54,'CL','Форм-фактор','Трансформер с поворотным экраном','','2_in_1'),(55,'CL','Форм-фактор','Мини до 12\"','','12_мини'),(56,'CL','Форм-фактор','Большой экран 16\" и более','','16>'),(57,'GO','','Премиальный','Ноутбуки премиальных серий (кроме игровых), топовый дизайн, имидж','Премиальный'),(58,'GO','Коммерческий','Корпоративный','Бизнес-ноутбук топового уровня,  высокая прочность, PRO-компоненты, ср-ва безопасности, имидж','Корпоративный'),(59,'GO','Коммерческий','Бизнес средний','Стандартные бизнес-ноутбуки, устройства для сферы малого и среднего бизнеса, высокая прочность, ср-ва безопасности','Бизнес_средний'),(60,'GO','Коммерческий','Для массовых рабочих мест','Бюджетные бизнес-ноутбуки для массовых рабочих мест и стандартных деловых приложений','Бизнес_массовый'),(61,'GO','Общее назначение','Для коммуникаций и просмотра','Ноутбуки для работы в Сети и потребления контента на энергосбрегающих или удешевленных процессорах.\n А также ультракомпактные ноутбуки (ультрабуки) на стандартных процессорах с экраном до 13\" включительно со встроенной графикой','Просмотр_контента'),(62,'GO','Общее назначение','Для обычной работы и учебы','Ноутбук для работы и учебы c экраном 14\", 15\" или 17\"\n\"Рабочая лошадка\";\n НЕ включая \"Премиальные\" модели и \"Трансформеры 2-in-1\"\nСтандартный мобильный процессор, встроенная графика\n\nКроме премиальных моделей и трансформеров.','Для_работы_и_учебы'),(63,'GO','Общее назначение','Для творчества или разработки','Нотбук достаточной производительности для задач Content-creation или программирования. \nСтандартный или продвинутый процессор, с внешней графикой. С экраном от 14\" и более.','Создание_контента'),(64,'GO','Общее назначение','Универсальный домашний','Универсальный ноутбук потребительского типа 15\"-17\"\nСтандартный или продвинутый процессор \nГрафика: встроенная, внешня легкая или игровая среднего уровня','Домашний'),(65,'GO','','Ультрабук','Компактные ноутбуки с экраном от 12\", 13\" или 14\".\nНе смоторя на габариты - полнофункциональные устройства на базе стандартных мобильных процессоров.','Ультрабук'),(66,'GO','Общее назначение','Игровой','Стандартный или продвинутый процессор, игровая видеокарта среднего или высокого класса: Nvidia GTX/RTX или AMD RX','Игровой'),(67,'GO','Общее назначение','Профессиональная рабочая станция','Мощная машина для инженерных и дизайнерских задач, профессиональная видеокарта','Мобильная_ПРС'),(68,'CL','Форм-фактор','Ультракомпактный 13\"','','13inch'),(69,'CL','Форм-фактор','Компактный 14\"','','14inch'),(70,'CL','Форм-фактор','Стандартный размер 15\"','','15inch');
