f=\"/Ups/859\" target=\"_blank\">Ippon Back Basic 650S Euro</a></strong>.</p>\r\n\r\n<p style=\"margin-bottom:13px\"><img alt=\"Ippon Back Basic 650s Euro.jpg\" src=\"/static/marketability/pict/rate/ippon_back_basic_650s_euro.jpg\" style=\"margin-top: 10px; margin-bottom: 10px; width: 300px; height: 201px;\" /></p>\r\n\r\n<p style=\"margin-bottom:13px\"><strong><a href=\"/Ups/?GO_lowend=Yes&amp;CL_euro=Yes&amp;tabs=marketability\">Полный список популярных моделей ИБП начального уровня для домашнего использования с обычными розетками можно посмотреть здесь.&nbsp;</a></strong></p>\r\n\r\n<p style=\"margin-bottom:13px\"><a href=\"/rate/Ups/8\">А если же требуются устройства с&nbsp;компьютерными&nbsp;розетками&nbsp;стандарта IEC - вот информация по таким моделям</a>.</p>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Ups/?tabs=marketability\">Выбрать ИБП для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Ups/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Ups/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n</div>\r\n\r\n<div>\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Ups/?GO_lowend=Yes&amp;CL_euro=Yes&amp;tabs=marketability\">Top-20 ИБП начального уровня для дома</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Ups/?GO_lowend=Yes&amp;CL_euro=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Ups/?GO_lowend=Yes&amp;CL_euro=Yes&amp;tabs=marketability\">Для дома, начального уровня</a></div>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Ups/?GO_lowend=Yes&amp;CL_euro=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Ups/?GO_lowend=Yes&amp;CL_euro=Yes&amp;tabs=marketability\">ЕВРО-розетки</a></div>\r\n</div>\r\n</div>','Ups','2021-09-16','/static/marketability/pict/rate/ippon_back_basic_650s_euro.jpg',0),(10,'10','Лучшие ИБП продвинутого уровня для дома','Летом 2021 наиболее популярной моделью ИБП для дома, продвинутого уровня на нашем рынке стал Cyberpower BR700ELCD.','Летом 2021 наиболее популярной моделью ИБП для дома, продвинутого уровня на нашем рынке стал Cyberpower BR700ELCD.','<p>По данным ITResearch и &laquo;Гида Покупателя&raquo; летом 2021 наиболее популярной моделью ИБП для дома, продвинутого уровня, с Евро-розетками, на отечественном рынке стал <strong><a href=\"/Ups/590\">Cyberpower BR700ELCD</a></strong>.</p>\r\n\r\n<p><img alt=\"Cyberpower BRr00ELCD\" src=\"/static/marketability/pict/rate/cyberpower_br700elcd.jpg\" style=\"margin-top: 10px; margin-bottom: 10px; width: 300px; height: 179px;\" /></p>\r\n\r\n<p>Стоит отметить, что 7 из 10 наиболее продаваемых моделей в данной категории имеют&nbsp;реализовацию&nbsp;с евророзетками.&nbsp;</p>\r\n\r\n<p><strong><a href=\"/Ups/?GO_homeplus=Yes&amp;tabs=marketability\" target=\"_blank\">Полный рейтинг наиболее продаваемых в России модлей продвинутых ИБП домашнего класса можно посмотеть здесь.</a></strong></p>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Ups/?tabs=marketability\">Выбрать ИБП для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Ups/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Ups/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n</div>\r\n\r\n<div>\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Ups/?GO_homeplus=Yes&amp;tabs=marketability\">Top-20 ИБП продвинутого уровня для дома</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Ups/?GO_homeplus=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Ups/?GO_homeplus=Yes&amp;tabs=marketability\">Для дома, продвинутого уровня</a></div>\r\n</div>\r\n</div>','Ups','2021-09-16','/static/marketability/pict/rate/cyberpower_br700elcd.jpg',0),(11,'11','Лучший ИБП для игровых ПК и рабочих станций','Летом 2021 в России наиболее популярной моделью ИБП для игровых ПК и рабочих станций был APC by Schneider Electric BV1000I-GR','Летом 2021 в России наиболее популярной моделью ИБП для игровых ПК и рабочих станций был APC by Schneider Electric BV1000I-GR.','<p>По данным <a href=\"https://www.itbestsellers.ru\" target=\"_blank\">ITResearch</a> и <a href=\"https://allgid.ru\">&laquo;Гида Покупателя&raquo;</a> летом 2021 в России наиболее популярной моделью ИБП для игровых ПК и рабочих станций был <strong><a href=\"/Ups/1083\" target=\"_blank\">APC by Schneider Electric BV1000I-GR</a></strong> мощностью 1 кВА.&nbsp;</p>\r\n\r\n<p><img alt=\"APC BV1000I-GR\" src=\"/static/marketability/pict/rate/apc_bv1000_gr.jpg\" style=\"margin-top: 10px; margin-bottom: 10px; width: 300px; height: 150px;\" /></p>\r\n\r\n<p><a href=\"/Ups/?GO_gamer=Yes&amp;tabs=marketability\" target=\"_blank\"><strong>Полный рейтинг наиболее популярных в России моделей ИБП для игровых ПК и рабочих станций на лето 2021 года можно посмотреть здесь.</strong></a></p>\r\n\r\n<p>&nbsp;</p>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Ups/?tabs=marketability\">Выбрать ИБП для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Ups/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Ups/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n</div>\r\n\r\n<div>\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Ups/?GO_gamer=Yes&tabs=marketability\">Top-20 ИБП для игровых ПК и рабочих станций</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Ups/?GO_gamer=Yes&tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Ups/?GO_gamer=Yes&tabs=marketability\">Для игровых ПК и рабочих станций</a></div>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Ups/?GO_gamer=Yes&tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Ups/?GO_gamer=Yes&tabs=marketability\">EURO-розетки</a></div>\r\n</div>\r\n</div>','Ups','2021-09-16','/static/marketability/pict/rate/apc_bv1000_gr.jpg',0),(12,'12','Лучший ИБП для рабочих мест дома и в бизнесе','Наиболее популярной моделью ИБП длярабочих мест, как в SOHO (Small Office Home Office), так и в SMB (Small & Medium Business) и корпоративном секторе был Ippon Back Basic 650','Летом 2021 в России наиболее популярной моделью ИБП для организации рабочих мест, как в SOHO (Small Office Home Office), так и в SMB (Small & Medium Business) и корпоративном секторе был Ippon Back Basic 650.','<p> По данным <a href=\"https://www.itbestsellers.ru\" target=\"_blank\">ITResearch</a> и <a href=\"https://allgid.ru\">&laquo;Гида Покупателя&raquo;</a> летом 2021 в России наиболее популярной моделью ИБП для организации рабочих мест, как в SOHO (Small Office Home Office), так и в SMB (Small &amp; Medium Business)&nbsp;и корпоративном секторе был <strong><a href=\"/Ups/857\">Ippon Back Basic 650</a></strong>. Он же стал наиболее популярной&nbsp;моделью&nbsp;на домашнем рынке и в целом по всему отечественному рынку. </p>\r\n\r\n<p\"><img alt=\"Ippon Back Basic 650\" src=\"/static/marketability/pict/rate/ippon_back_basic_650.jpg\" style=\"margin-top: 10px; margin-bottom: 10px; width: 300px; height: 235px;\" /></p>\r\n\r\n<p><strong><a href=\"/Ups/?GO_soho=Yes&amp;tabs=marketability\" target=\"_blank\">Остальные бестселлеры ИБП в категории&nbsp;SOHO перечислены здесь:</a></strong></p>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Ups/?tabs=marketability\">Выбрать ИБП для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Ups/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Ups/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n</div>\r\n\r\n<div>\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Ups/?GO_soho=Yes&amp;tabs=marketability\">Top-20 для сегмента SOHO</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Ups/?GO_soho=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Ups/?GO_soho=Yes&amp;tabs=marketability\">Домашний офис, малый офис </a></div>\r\n</div>\r\n</div>','Ups','2021-09-16','/static/marketability/pict/rate/ippon_back_basic_650.jpg',0),(13,'13','Лучший легкий ИБП для критичного оборудования','летом 2021 в России наиболее популярной моделью легких ИБП для защиты серверов был Ippon Smart Winner II 3000','Летом 2021 в России наиболее популярной моделью легких ИБП для защиты критичного оборудования (серверы, хранилища данных и т .д.) был Ippon Smart Winner II 3000 мощностью 3 кВА.','<p>По данным <a href=\"https://www.itbestsellers.ru\" target=\"_blank\">ITResearch</a> и <a href=\"https://allgid.ru\">&laquo;Гида Покупателя&raquo;</a> летом 2021 в России наиболее популярной моделью легких ИБП для защиты критичного оборудования (серверы, хранилища данных и т .д.) был <strong><a href=\"/Ups/900\" target=\"_blank\">Ippon Smart Winner II 3000</a></strong> мощностью 3 кВА.</p>\r\n\r\n<p><img alt=\"Ippon Smart Winner II 3000\" src=\"/static/marketability/pict/rate/ippon_smart_winner_ii_3000.jpg\" style=\"margin-top: 10px; margin-bottom: 10px; width: 300px; height: 82px;\" /></p>\r\n\r\n<p>Это линейно-интерактивная модель с чистой синусоидой, реализованная в универсальном форм-факторе Rack/Tower (RT).</p>\r\n\r\n<p><strong><a href=\"/Ups/?GO_server=Yes&amp;tabs=marketability\" target=\"_blank\">Полный рейтинг самых продаваемых модeлей ИБП для защиты критического оборудования можно посмотреть здесь.</a></strong></p>\r\n\r\n<p>&nbsp;</p>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Ups/?tabs=marketability\">Выбрать ИБП для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Ups/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Ups/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n</div>\r\n\r\n<div>\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Ups/?GO_server=Yes&amp;tabs=marketability\">Top-20 ИБП для критичного оборудования (серверы, сетевое оборудование и т .д.)</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Ups/?GO_server=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Ups/?GO_server=Yes&amp;tabs=marketability\">Критичное оборудование (серверы и т .д.)</a></div>\r\n</div>\r\n</div>','Ups','2021-09-16','/static/marketability/pict/rate/ippon_smart_winner_ii_3000.jpg',0),(14,'14','Лучший монитор для дома начального уровня. Лето`2021','летом 2021 наиболее популярной моделью монитора  для дома, начального уровня был 21,5 дюйм Asus VP228DE стоимостью около 8800 руб.','Летом 2021 наиболее популярной моделью монитора  для дома, начального уровня в России был 21,5 дюйм Asus VP228DE стоимостью около 8800 руб.','<p><em>Источник: аналитическая компания <a href=\"https://itbestsellers.ru\" target=\"_blank\">ITResearch</a>, проект <a href=\"https://allgid.ru\">allgid.ru &quot;Гид покупателя&quot;</a></em></p>\r\n\r\n<p>Мониторы начального уровня - это самые простые и недорогие аппараты, что называется - лишь бы показывал.&nbsp;</p>\r\n\r\n<p>Летом`21 наиболее популярной моделью монитора &nbsp;для дома и учебы, начального уровня был 21.5 дюйм <strong><a href=\"/Mnt/3029\" target=\"_blank\">Asus VP228DE</a></strong> стоимостью около 8800 рублей. &nbsp;</p>\r\n\r\n<p><img alt=\"Asus VP228DE\" src=\"/static/marketability/pict/rate/asus_vp228de.jpg\" style=\"margin-top: 10px; margin-bottom: 10px; width: 300px; height: 239px;\" /></p>\r\n\r\n<p>Самой доступной моделью в данной категории была модель <a href=\"/Mnt/3589\"><strong>Philips 220V8L</strong></a> &nbsp;с такой же диагональю стоимостью около 6,5 тыс. руб.</p>\r\n\r\n<p>Такие мониторы наиболее просты, дешевы, что называется - лишь бы показывал.</p>\r\n\r\n<p><a href=\"/Mnt/?Начального+уровня=Yes&amp;Для+учебы%2C+работы+и+развлечений=Yes&amp;tabs=marketability\" target=\"_blank\"><strong>Остальные бестселлеры в данном &nbsp;классе Универсальных мониторв для работы и учебы Начального уровня приводится здесь &gt;&gt;</strong></a>&nbsp;</p>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Mnt/?tabs=marketability\">Выбрать монитор для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"//Mnt/?tabs=marketability/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"//Mnt/?tabs=marketability/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n</div>\r\n\r\n<div>\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Mnt/?Начального+уровня=Yes&amp;Для+учебы%2C+работы+и+развлечений=Yes&amp;tabs=marketability\">Top-20 универсальных мониторов начального уровня</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Mnt/?Начального+уровня=Yes&amp;Для+учебы%2C+работы+и+развлечений=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Mnt/?Начального+уровня=Yes&amp;Для+учебы%2C+работы+и+развлечений=Yes&amp;tabs=marketability\">Начального уровня</a></div>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Mnt/?Начального+уровня=Yes&amp;Для+учебы%2C+работы+и+развлечений=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Mnt/?Начального+уровня=Yes&amp;Для+учебы%2C+работы+и+развлечений=Yes&amp;tabs=marketability\">Универсальный, для учебы и работы</a></div>\r\n</div>\r\n</div>','Mnt','2021-09-17','/static/marketability/pict/rate/asus_vp228de.jpg',0),(15,'15','Лучший монитор для офиса начального уровня. Лето`2021','летом 2021 наиболее популярной моделью монитора для офиса, начального уровня, был 21.5 дюйм HP V22 стоимостью около 8900 руб.','Летом 2021 наиболее популярной моделью монитора для офиса, начального уровня, был 21.5 дюйм HP V22 стоимостью около 8900 рублей.','<p><em>Источник: аналитическая компания <a href=\"https://itbestsellers.ru\" target=\"_blank\">ITResearch</a>, проект <a href=\"https://allgid.ru\">allgid.ru &quot;Гид покупателя&quot;</a></em></p>\r\n\r\n<div class=\"inarticle_cit1\">\r\n<p>Среди офисных мониторов, указанных в каталоге производителей как &quot;корпоративные&quot; достаточно недорогих моделей, с небольшими экранами и без особого дополнительного функционала. Такие устройства предназначены для массовых поставок на рабочие места персонала.</p>\r\n</div>\r\n\r\n<p>Летом 2021 наиболее популярной моделью монитора для офиса, начального уровня, был 21.5 дюйм <a href=\"/Mnt/3305\" target=\"_blank\"><strong>HP V22</strong></a> стоимостью около 8900 рублей.</p>\r\n\r\n<p><img alt=\"HP V22\" src=\"/static/marketability/pict/rate/Mnt/hp_v19.jpg\" style=\"margin-top: 10px; margin-bottom: 10px; width: 300px; height: 305px;\" /></p>\r\n\r\n<p>Самой же доступной моделью такого класса в категории была <a href=\"/Mnt/3997\" target=\"_blank\"><strong>HP v19</strong></a> с диагональю 18,5 и стоимостью менее 6 тыс. рублей.</p>\r\n\r\n<p><strong><a href=\"/Mnt/?Начального+уровня=Yes&amp;Для+офиса+%28Корпоративный%29=Yes&amp;tabs=marketability\" target=\"_blank\">Рейтинг наиболее популярных летом 2021 года офисных мониторов начального уровня можно посмотреть здесь &gt;&gt;</a></strong></p>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Mnt/?tabs=marketability\">Выбрать монитор для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Mnt/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Mnt/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n</div>\r\n\r\n<div>\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Mnt/?Начального+уровня=Yes&amp;Для+офиса+%28Корпоративный%29=Yes&amp;tabs=marketability\">Top-20 офисных мониторов начального уровня</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Mnt/?Начального+уровня=Yes&amp;Для+офиса+%28Корпоративный%29=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Mnt/?Начального+уровня=Yes&amp;Для+офиса+%28Корпоративный%29=Yes&amp;tabs=marketability\">Начального уровня </a></div>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Mnt/?Начального+уровня=Yes&amp;Для+офиса+%28Корпоративный%29=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Mnt/?Начального+уровня=Yes&amp;Для+офиса+%28Корпоративный%29=Yes&amp;tabs=marketability\">Офисный</a></div>\r\n</div>\r\n</div>','Mnt','2021-09-20','/static/marketability/pict/rate/Mnt/hp_v19.jpg',0),(16,'reyting-populiarnosti-mini-transformerov-dlia-shkolnikov__-inostrannye-brendy__-avgust-21','Рейтинг популярности мини-трансформеров для школьников. Иностранные бренды. Август` 21','Рейтинг популярности мини-ноутбуков трансформеров 2-в-1 для школьного образования. Иностранные бренды. Август 2021','В августе 2021 г. лидером продаж в сегменте ноутбуков \"Форм-фактор\": \"Трансформер с поворотным экраном\"; \"Мини до 12\"\" стала модель Lenovo IdeaPad Flex 3 11ADA05.','<p><em>Источник: аналитическая компания <a href=\"https://itbestsellers.ru\" target=\"_blank\">ITResearch</a>, проект <a href=\"https://allgid.ru\">allgid.ru &quot;Гид покупателя&quot;</a><br />\r\nДанные по рынку России</em></p>\r\n\r\n<div class=\".inarticle_cit1\">\r\n<p>Зачастую, для детей младшего школьного возраста предпочтительными являются маленькие ноутбуки-трансформеры с сенсорным экраном 2-в-1.<br />\r\nДиагональ экрана здесь может быть от 10&quot; до 12&quot;. Наиболее частый случай - экраны 11,6&quot; с разрешением HD (1366x768).</p>\r\n\r\n<p>В продаже можно найти большое число подобных моделей от отечественных сборщиков; скажем, таких марок как ICL (RayBook), Irbis, iRu, Digma, Prestigio, Aquarius. Но в данном случае рассматривается только продукция международных производителей.</p>\r\n\r\n<div class=\"inarticle_disclaimer\">\r\n<p>(Такие устройства часто закупаются&nbsp;для школ по программам госзакупок, однако не все &quot;тендерные&quot; модели оказываются доступны в широкой розничной продаже.<br />\r\nВажно здесь, что наличие&nbsp;госбюджетных&nbsp;программ&nbsp;в этой области мотивирует появление&nbsp;достаточно большого количества&nbsp;образовательного ПО - обычного и он-лайн -&nbsp;с внешним интерфейсом, адаптированным для таких маленьких дисплеев и сенсорного ввода. Ведь разработчики заинтресованны&nbsp;предлагать такие решения под госконтракты.)</p>\r\n\r\n<h3>Лидер продаж</h3>\r\n</div>\r\n</div>\r\n\r\n<p>В августе 2021 г. лидером продаж в сегменте ноутбуков <em>&laquo;Форм-фактор&raquo;: &laquo;Трансформер с поворотным экраном&raquo;; &laquo;Мини до 12&quot;&raquo;</em> стала модель <strong><a href=\"/Nb/4880\" target=\"_blank\">Lenovo IdeaPad Flex 3 11ADA05</a></strong> на базе дешевого&nbsp;процессора AMD Athlon 3020e. Имеется также и ее модификация с чипами&nbsp;Intel Celeron N (<strong>11IGL05</strong>). Эти модели остаются также и самыми доступными&nbsp;по цене устройствами&nbsp;в данном классе ноутбуков. (По крайне мере среди импортной продукции).</p>\r\n\r\n<p><img alt=\"Lenovo IdeaPad Flex 3 11ADA05\" src=\"/static/marketability/pict/rate/Nb/lenovo_ideadad_Flex_3_11ADA05.jpg\" style=\"width: 300px; height: 199px;\" /></p>\r\n\r\n<h2>Ноутбуки класса Мини-трансформеры: Top-4, в августе `21</h2>\r\n\r\n<div class=\"inarticle_table_wrap_outer\">\r\n<div class=\"inarticle_table_wrap\">\r\n<table class=\"inarticle_table\">\r\n	<thead>\r\n		<tr>\r\n			<th>Название</th>\r\n			<th>Цена</th>\r\n			<th>Процессор от</th>\r\n			<th>Поколение проц.</th>\r\n			<th>Разрешение экрана</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr class=\"tr-top\">\r\n			<th><a href=\"/Nb/4880\">♔ Lenovo IdeaPad Flex 3 11ADA05</a></th>\r\n			<td>24&nbsp;990</td>\r\n			<td>AMD</td>\r\n			<td>Ryzen (1Gen)</td>\r\n			<td>1366x768</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/3893\">Lenovo IdeaPad Flex 3 11IGL05</a></th>\r\n			<td>24&nbsp;990</td>\r\n			<td>Intel</td>\r\n			<td>Gemini Lake</td>\r\n			<td>1366x768</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/5418\">Dell Latitude 3120 2-in-1</a></th>\r\n			<td>31&nbsp;200</td>\r\n			<td>Intel</td>\r\n			<td>Jasper Lake</td>\r\n			<td>1366x768</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/5176\">Asus Pro BR1100F</a></th>\r\n			<td>38&nbsp;720</td>\r\n			<td>Intel</td>\r\n			<td>Jasper Lake</td>\r\n			<td>1366х768</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n\r\n<p><span style=\"font-size:larger;\"><strong><a href=\"/Nb/?CL_2_in_1=Yes&amp;CL_mini=Yes&amp;tabs=marketability\">Полный актуальный рейтинг Top-20 популярных ноутбуков типа <em>&quot;Форм-фактор&quot;: &quot;Трансформер с поворотным экраном&quot;</em> &gt;&gt;</a></strong></span></p>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Nb/?tabs=marketability\">Выбрать ноутбуки для своих целей</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Nb/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Nb/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n</div>\r\n\r\n<div>\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Nb/?CL_2_in_1=Yes&amp;CL_mini=Yes&amp;tabs=marketability\">Top-20 Мини-трансформеры</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Nb/?CL_2_in_1=Yes&amp;CL_mini=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Nb/?CL_2_in_1=Yes&amp;CL_mini=Yes&amp;tabs=marketability\">Трансформер с поворотным экраном </a></div>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Nb/?CL_2_in_1=Yes&amp;CL_mini=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Nb/?CL_2_in_1=Yes&amp;CL_mini=Yes&amp;tabs=marketability\">Мини до 12&quot; </a></div>\r\n</div>\r\n</div>','Nb','2021-10-04','/static/marketability/pict/rate/Nb/lenovo_ideadad_Flex_3_11ADA05.jpg',0),(17,'reiting-printerov-i-nastolnykh-mfu-dlia-doma-i-ucheby__avgust_21','Рейтинг принтеров и настольных МФУ для дома и учебы. Август`21','Рейтинг популярности в России устройств печати - принтеров и настольных МФУ для дома и учебы. Недорогие лазерные и струйные. Август 2021.','В августе`21 среди устройств печати \"для дома и учебы\" по объемам реализации стали две модели от Xerox - лазерный принтер Phaser 3020BI и лазерный МФУ WorkCentre 3025BI','<p><em>Источник: аналитическая компания <a href=\"https://itbestsellers.ru\" target=\"_blank\">ITResearch</a>, проект <a href=\"https://allgid.ru\">allgid.ru &quot;Гид покупателя&quot;</a><br />\r\nПо данным реальных продаж в России</em></p>\r\n\r\n<p>В категорию печатающих устройств, рекомендуемых для использования в домашнем &laquo;делопроизводстве&raquo; (распечатка, копирование или оцифровка различных справок, списков личных документов и т. п.), а также для учебных целей (распечатка материалов из интернет, копирование конспектов и т. п.), включены &nbsp;более 70 моделей черно-белых принтеров и настольных много-функциональных устройств (МФУ).&nbsp;</p>\r\n\r\n<p>Большинство составляют относительно недорогие лазерные устройства формата А4 со скоростью печати до 30 стр./мин, но присутствуют также и несколько монохромных струйных моделей со встроенной системой непрерывной подачи чернил (СНПЧ), обеспечивающих экономичную печать. Последние будут особенно полезны тем, кто печатает часто и много.</p>\r\n\r\n<p>В данной категории представлены продукты всех основных производителей печатающих устройств, однако в десятку наиболее продаваемых в августе вошли только лазерные устройства трех вендоров HP, Pantum и Xerox - семь моделей &nbsp;настольных МФУ и три принтера.&nbsp;</p>\r\n\r\n<h2>Рейтинг принтеров и настольных МФУ для дома и учебы. Август`21</h2>\r\n\r\n<p>Представленная в таблице первая десятка моделей-бестселлеров отсортирована по возрастанию средней цены, действующей в конце августа.</p>\r\n\r\n<p>Вполне естественно, что первые места в ценовом рейтинге занимают обычные принтеры, а ниже расположены более дорогие модели настольных МФУ.</p>\r\n\r\n<div class=\"inarticle_table_wrap_outer\">\r\n<div class=\"inarticle_table_wrap\">\r\n<table class=\"inarticle_table\">\r\n	<thead>\r\n		<tr>\r\n			<th>Название</th>\r\n			<th>Цена, руб.</th>\r\n			<th>Тип</th>\r\n			<th>Скорость, стр./мин</th>\r\n			<th>Работа в сети</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td><a href=\"/Mfp/4961\">Pantum&nbsp;P2207</a></td>\r\n			<td><b>6&nbsp;193</b></td>\r\n			<td align=\"center\">принтер</td>\r\n			<td align=\"center\">20</td>\r\n			<td align=\"center\">&nbsp;</td>\r\n		</tr>\r\n		<tr class=\"tr-top\">\r\n			<td><a href=\"/Mfp/5050\">Xerox&nbsp;Phaser 3020BI</a></td>\r\n			<td><b>7&nbsp;970</b></td>\r\n			<td align=\"center\">принтер</td>\r\n			<td align=\"center\">20</td>\r\n			<td align=\"center\">Wi-Fi</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"/Mfp/4670\">HP&nbsp;Laser 107a</a></td>\r\n			<td><b>7&nbsp;991</b></td>\r\n			<td align=\"center\">принтер</td>\r\n			<td align=\"center\">20</td>\r\n			<td align=\"center\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"/Mfp/4948\">Pantum&nbsp;M6500</a></td>\r\n			<td><b>9&nbsp;774</b></td>\r\n			<td align=\"center\">МФУ</td>\r\n			<td align=\"center\">22</td>\r\n			<td align=\"center\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"/Mfp/4949\">Pantum&nbsp;M6500W</a></td>\r\n			<td><b>10&nbsp;290</b></td>\r\n			<td align=\"center\">МФУ</td>\r\n			<td align=\"center\">22</td>\r\n			<td align=\"center\">Wi-Fi</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"/Mfp/5073\">Xerox&nbsp;WorkCentre 3025BI</a></td>\r\n			<td><b>12&nbsp;550</b></td>\r\n			<td align=\"center\">МФУ</td>\r\n			<td align=\"center\">20</td>\r\n			<td align=\"center\">Wi-Fi</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"/Mfp/4672\">HP&nbsp;Laser 135a</a></td>\r\n			<td><b>12&nbsp;621</b></td>\r\n			<td align=\"center\">МФУ</td>\r\n			<td align=\"center\">20</td>\r\n			<td align=\"center\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"/Mfp/4691\">HP&nbsp;LaserJet M28a</a></td>\r\n			<td><b>12&nbsp;938</b></td>\r\n			<td align=\"center\">МФУ</td>\r\n			<td align=\"center\">18</td>\r\n			<td align=\"center\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"/Mfp/4673\">HP&nbsp;Laser 135w</a></td>\r\n			<td><b>13&nbsp;628</b></td>\r\n			<td align=\"center\">МФУ</td>\r\n			<td align=\"center\">20</td>\r\n			<td align=\"center\">Wi-Fi</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"/Mfp/5047\">Xerox&nbsp;B205</a></td>\r\n			<td><b>16&nbsp;511</b></td>\r\n			<td align=\"center\">МФУ</td>\r\n			<td align=\"center\">30</td>\r\n			<td align=\"center\">&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n\r\n<h3>Лидер продаж</h3>\r\n\r\n<p><img alt=\"Xerox Phaser 3020BI\" src=\"/static/marketability/pict/rate/Mfp/Xerox_Phaser_3020BI.jpg\" style=\"width: 300px; height: 236px;\" /></p>\r\n\r\n<p><span style=\"font-size:smaller;\"><em>Xerox&nbsp;Phaser 3020BI</em></span></p>\r\n\r\n<p>Среди устройств печати &#39;для дома и учебы&quot;&nbsp;по объемам реализации две модели от <strong>Xerox</strong> - лазерный принтер <a href=\"/Mfp/5050\">Phaser 3020BI</a> и лазерный МФУ <a href=\"/Mfp/5073\">WorkCentre 3025BI</a>.</p>\r\n\r\n<p><img alt=\"Xerox Phaser 3020BI\" src=\"/static/marketability/pict/rate/Mfp/Xerox_WorkCentre_3025BI.jpg\" style=\"width: 300px; height: 236px;\" /></p>\r\n\r\n<p><span style=\"font-size:smaller;\"><em>Xerox WorkCentre_3025BI</em></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Лучшие принтеры и МФУ в категории &quot;для дома и учебы&quot; по продажам, цене и общей стоимости владения (TCO).</h2>\r\n\r\n<p>Для сопоставления мы приводим список Top-10 вышеозначенных моделей-лидеров отсортированные:</p>\r\n\r\n<ul>\r\n	<li>По популярности (количеству проданных устройств за август`21);</li>\r\n	<li>По цене (по возрастанию)</li>\r\n	<li>По общим затратам на приобретение и эксплуатацию моделей (по возрастанию). Показатель ТСО - Total Cost of Ownership, в данном случае &ndash; при регулярной печати в среднем 300 страниц в месяц. ТСО определяется с учетом средних цен на устройства и оригинальные картриджи с максимальным для данной модели ресурсом.</li>\r\n</ul>\r\n\r\n<div class=\"inarticle_table_wrap_outer\">\r\n<div class=\"inarticle_table_wrap\">\r\n<table class=\"inarticle_table\">\r\n	<thead>\r\n		<tr>\r\n			<th>По популярности</th>\r\n			<th>По цене</th>\r\n			<th>По общим затратам<br />\r\n			при печати &nbsp;300 стр./мес</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td><a href=\"/Mfp/5050\">Xerox&nbsp;Phaser 3020BI</a></td>\r\n			<td><a href=\"/Mfp/4961\">Pantum&nbsp;P2207</a></td>\r\n			<td align=\"center\"><a href=\"/Mfp/4961\">Pantum&nbsp;P2207</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"/Mfp/5073\">Xerox&nbsp;WorkCentre 3025BI</a></td>\r\n			<td><a href=\"/Mfp/5050\">Xerox&nbsp;Phaser 3020BI</a></td>\r\n			<td align=\"center\"><a href=\"/Mfp/5047\">Xerox&nbsp;B205</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"/Mfp/4673\">HP&nbsp;Laser 135w</a></td>\r\n			<td><a href=\"/Mfp/4670\">HP&nbsp;Laser 107a</a></td>\r\n			<td align=\"center\"><a href=\"/Mfp/4948\">Pantum&nbsp;M6500</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"/Mfp/4948\">Pantum&nbsp;M6500</a></td>\r\n			<td><a href=\"/Mfp/4948\">Pantum&nbsp;M6500</a></td>\r\n			<td align=\"center\"><a href=\"/Mfp/4949\">Pantum&nbsp;M6500W</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"/Mfp/4672\">HP&nbsp;Laser 135a</a></td>\r\n			<td><a href=\"/Mfp/4949\">Pantum&nbsp;M6500W</a></td>\r\n			<td align=\"center\"><a href=\"/Mfp/5050\">Xerox&nbsp;Phaser 3020BI</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"/Mfp/4949\">Pantum&nbsp;M6500W</a></td>\r\n			<td><a href=\"/Mfp/5073\">Xerox&nbsp;WorkCentre 3025BI</a></td>\r\n			<td align=\"center\"><a href=\"/Mfp/5073\">Xerox&nbsp;WorkCentre 3025BI</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"/Mfp/4961\">Pantum&nbsp;P2207</a></td>\r\n			<td><a href=\"/Mfp/4672\">HP&nbsp;Laser 135a</a></td>\r\n			<td align=\"center\"><a href=\"/Mfp/4670\">HP&nbsp;Laser 107a</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"/Mfp/4670\">HP&nbsp;Laser 107a</a></td>\r\n			<td><a href=\"/Mfp/4691\">HP&nbsp;LaserJet M28a</a></td>\r\n			<td align=\"center\"><a href=\"/Mfp/4672\">HP&nbsp;Laser 135a</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"/Mfp/4691\">HP&nbsp;LaserJet M28a</a></td>\r\n			<td><a href=\"/Mfp/4673\">HP&nbsp;Laser 135w</a></td>\r\n			<td align=\"center\"><a href=\"/Mfp/4673\">HP&nbsp;Laser 135w</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"/Mfp/5047\">Xerox&nbsp;B205</a></td>\r\n			<td><a href=\"/Mfp/5047\">Xerox&nbsp;B205</a></td>\r\n			<td align=\"center\"><a href=\"/Mfp/4691\">HP&nbsp;LaserJet M28a</a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Mfp/?tabs=marketability\">Выбрать принтер или МФУ для своих целей</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Mfp/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Mfp/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n</div>\r\n\r\n<div>\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Mfp/?2+Для+школьников+и+студентов=Yes&amp;3+Для+домашних+дел=Yes&amp;tabs=marketability\">Top-20 устройств печати для дома и учебы</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Mfp/?2+Для+школьников+и+студентов=Yes&amp;3+Для+домашних+дел=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Mfp/?2+Для+школьников+и+студентов=Yes&amp;3+Для+домашних+дел=Yes&amp;tabs=marketability\">Для учащихся</a></div>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Mfp/?2+Для+школьников+и+студентов=Yes&amp;3+Для+домашних+дел=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Mfp/?2+Для+школьников+и+студентов=Yes&amp;3+Для+домашних+дел=Yes&amp;tabs=marketability\">Для домашних дел</a></div>\r\n</div>\r\n</div>','Mfp','2021-10-04','/static/marketability/pict/rate/Mfp/Xerox_Phaser_3020BI.jpg',0),(18,'reyting-populiarnosti-noutbukov__-obshchiy-zachet__-avgust-21','Рейтинг популярности ноутбуков. Общий зачет. Август` 21','В данной статье приведен общий рейтинг популярности моделей ноутбуков исходя из данных реальных продаж в России за август 2021 г. Top-10. Самым продаваемой моделью стал недорогой 15\" ноутбук HP 15s-eq1 на базе процессора AMD.','Здесь дан общий рейтинг популярности моделей ноутбуков Top-10 без разделения по классам и типам за август 2021 г. \r\nСамым продаваемой моделью стал недорогой 15\" ноутбук HP 15s-eq1 на базе процессора AMD.','<p><em>Источник: аналитическая компания <a href=\"https://itbestsellers.ru\" target=\"_blank\">ITResearch</a>, проект <a href=\"https://allgid.ru\">allgid.ru &quot;Гид покупателя&quot;</a><br />\r\nДанные по рынку России</em></p>\r\n\r\n<div class=\"inarticle_cit1\">\r\n<p>В данной статье приводится&nbsp;общий рейтинг популярности модлей мобильных ПК. Разделение по типам, размерам, целевому назначению не используется.<br />\r\nЕстественно, такой рейтинг - &quot;общая температура по больнице&quot;, однако она позволяет понять какие продукты пользуются наибольшим спросом в целом.</p>\r\n</div>\r\n\r\n<h3>Лидер продаж</h3>\r\n\r\n<p>В августе 2021 г. лидером продаж стала модель <strong><a href=\"/Nb/3461\" target=\"_blank\">HP 15s-eq1000</a>&nbsp;</strong>-&nbsp; облегченный 15&quot; ноутбук с&nbsp;процеccорами&nbsp;AMD разных классов, начиная с совсем уже дешевого - Athlon 3020e, до более-мнее приемлемого - Ryzen 3.</p>\r\n\r\n<p><img alt=\"HP 15s-eq1\" src=\"/static/marketability/pict/rate/Nb/hp_15s-eq1.jpg\" style=\"width: 300px; height: 229px;\" /></p>\r\n\r\n<p>Самым же недорогим устройством, по крайней мере среди продукции международных производителей&nbsp;является модель <a href=\"/Nb/5049\" target=\"_blank\">Acer TravelMate B118-M</a>&nbsp;(11,6&quot;) стоимостью 15.3 тыс. руб. в среднем. Этот мини-ноутбук ориентирован скорее на детей школьного возраста, и у же не первый месяц остается самой бюджетной моделью на российских полках, если не считать дешевую продукциию локальных брендов.</p>\r\n\r\n<h2>Ноутбуки, общий рейтинг: Top-10, в августе `21</h2>\r\n\r\n<p><em>Сортировка по возрастанию цены.</em></p>\r\n\r\n<div class=\"inarticle_table_wrap_outer\">\r\n<div class=\"inarticle_table_wrap\">\r\n<table class=\"inarticle_table\">\r\n	<thead>\r\n		<tr>\r\n			<th>Название</th>\r\n			<th>Цена</th>\r\n			<th>Экран, &quot;</th>\r\n			<th>Произв проц.</th>\r\n			<th>Графика</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<th><a href=\"/Nb/2775\">Acer Extensa 215-31</a></th>\r\n			<td>29&nbsp;653</td>\r\n			<td>15</td>\r\n			<td>Intel</td>\r\n			<td>Встроенная</td>\r\n		</tr>\r\n		<tr class=\"tr-top\">\r\n			<th><a href=\"/Nb/3461\">♔ HP HP 15s-eq1000</a></th>\r\n			<td>33&nbsp;814</td>\r\n			<td>15</td>\r\n			<td>AMD</td>\r\n			<td>Встроенная</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/3862\">Lenovo IdeaPad S145-15API</a></th>\r\n			<td>34&nbsp;857</td>\r\n			<td>15</td>\r\n			<td>AMD</td>\r\n			<td>Встроенная</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4982\">Asus Asus R565J</a></th>\r\n			<td>39&nbsp;989</td>\r\n			<td>15</td>\r\n			<td>Intel</td>\r\n			<td>Встроенная</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/3584\">HP Essential 255 G7</a></th>\r\n			<td>40&nbsp;118</td>\r\n			<td>15</td>\r\n			<td>AMD</td>\r\n			<td>Встроенная</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4859\">HP HP 15s-fq2000 Core</a></th>\r\n			<td>42&nbsp;761</td>\r\n			<td>15</td>\r\n			<td>Intel</td>\r\n			<td>Встроенная</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/5034\">Lenovo IdeaPad 3 14ITL6</a></th>\r\n			<td>46&nbsp;757</td>\r\n			<td>14</td>\r\n			<td>Intel</td>\r\n			<td>Встроенная</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4341\">Lenovo IdeaPad Gaming 3 15IMH05</a></th>\r\n			<td>71&nbsp;307</td>\r\n			<td>15</td>\r\n			<td>Intel</td>\r\n			<td>GTX1650, GTX1650 Ti</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4833\">Acer TravelMate P215-53</a></th>\r\n			<td>71&nbsp;394</td>\r\n			<td>15</td>\r\n			<td>Intel</td>\r\n			<td>Встроенная</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4787\">Apple Macbook Air 13 2020 (M1)</a></th>\r\n			<td>130&nbsp;670</td>\r\n			<td>13</td>\r\n			<td>Apple</td>\r\n			<td>Встроенная</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n\r\n<p><span style=\"font-size:larger;\"><strong><a href=\"/Nb/?tabs=marketability\">Полный рейтинг Top-20 популярных ноутбуков ⋙</a></strong></span></p>\r\n\r\n<p>Как и следовало полагать - большая часть общего зачета определяется относительно низкой ценой, и включает потребительские и деловые модели, что называется класса &quot;рабочая лошадка&quot;.</p>\r\n\r\n<p>При этом совсем уж&nbsp;дешевой начинки, скажем, на усеченной компонентной базе типа Intel Celeron/Pentium Silver серии N мы здесь видим не много:&nbsp;фактически только в <a href=\"/Nb/2775\">Acer Extensa 215-31</a>&nbsp;(Gemini Lake), ну и самые дешевые комплектации лидера - <a href=\"/Nb/3461\">HP 15s-eq1</a>.</p>\r\n\r\n<p>При этом в топы выбираются даже средние модели&nbsp;игровой конфигурации, типа&nbsp;<a href=\"/Nb/4341\">Lenovo IdeaPad Gaming 3 15IMH05</a>. Ну и конечно -&nbsp;самая&nbsp;популярная их премиальных модлей -&nbsp;<a href=\"/Nb/4787\">Apple Macbook Air 13 2020 (M1)</a>.</p>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Nb/?tabs=marketability\">Выбрать ноутбуки для своих целей</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Nb/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Nb/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n</div>','Nb','2021-10-05','/static/marketability/pict/rate/Nb/hp_15s-eq1.jpg',0),(19,'reyting-populiarnosti-noutbukov-s-ekranom-13inch__-avgust-21','Рейтинг популярности ноутбуков (ультрабуков) 13\". Обычные и трансформерные форматы. Август `21.','В статье приводится общий рейтинг популярности ультрабуков 13\" и отдельный зачет по ноутбукам-трансформерам этого размера. В августе 2021 года победу одержали Apple Macbook и продукты HP.','В статье приводится общий рейтинг популярности ультрабуков 13\" и отдельный зачет по ноутбукам-трансформерам этого размера. В августе 2021 года победу одержали Apple Macbook и продукты HP.','<p><em>Источник: аналитическая компания <a href=\"https://itbestsellers.ru\" target=\"_blank\">ITResearch</a>, проект <a href=\"https://allgid.ru\">allgid.ru &quot;Гид покупателя&quot;</a><br />\r\nДанные по рынку России</em></p>\r\n\r\n<div class=\"inarticle_cit1\">\r\n<p>Ноутбуки (ультрабуки) с диагональю экрана 13&quot; в большинстве своем подаются, как <strong>элитные</strong> продукты. Это высокомобильные устройства с качественным исполнением и высокой имиджевой составляющей.</p>\r\n\r\n<p>В большинстве случаев ультракомпактные ноуты имеют вполне полноценную начинку - нормальные процессоры, объемы ОЗУ, стандартные (FHD) или даже большие разрешения экрана. И все-таки, подобные модели подойдут скорее для потребления контента и коммуникаций, нежели для работы со сложными документами и приложениями. Проблема в слишком маленьком экране для полноценной работы со сложными данными: при масштабировании 13&quot;-экрана на 100% - все слишком мелкое; при увеличении же масштаба - на дисплее умещается слишком малая часть окна приложения.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Общий рейтинг ультрабуков с экраном 13&quot;</h2>\r\n</div>\r\n\r\n<p>В августе 2021 г. лидером продаж в сегменте ноутбуков <em>&quot;Форм-фактор&quot;: &quot;Ультракомпактный 13&quot;&quot;</em> стала модель <strong><a href=\"/Nb/4787\" target=\"_blank\">Apple Macbook Air 13 2020 (M1)</a></strong>. Она лидируют в этом подсегменте много месяцев.</p>\r\n\r\n<p><img alt=\"Apple Macbook Air 2020 M1\" src=\"/static/marketability/pict/rate/Nb/apple_macbook_air_2020_m1.jpg\" style=\"width: 300px; height: 119px;\" /></p>\r\n\r\n<p><em>И вообще:&nbsp;лидерство в данном типоразмере типично для Apple отчасти по естественным причинам. Модельный ряд Macbook очень узок:&nbsp;у &quot;яблочных&quot; всего&nbsp;3 модели ноутбуков и 2 из них как раз 13&quot;. И почти все продажи культового бренда приходятся на 2 модели - они и становятся лидерами зачета. А у прочих вендоров - более широкий ассортимент, и их продажи распределяются по большему числу моделей;&nbsp;соответственно, на каждую отдельную приходится меньше.&nbsp;</em></p>\r\n\r\n<p>Так что, справедливости ради, упомянем и призера&nbsp;среди обычных ПК-ультрабуков<strong>&nbsp;</strong> этого размера. Им стал бизнес-ноутбук <strong><a href=\"/Nb/4865\">HP ProBook 430 G8</a>.</strong></p>\r\n\r\n<p><img alt=\"HP Probook 430 G8\" src=\"/static/marketability/pict/rate/Nb/hp_probook_430_g8.jpg\" style=\"width: 300px; height: 200px;\" /></p>\r\n\r\n<p>Самым же недорогим устройством данного класса является модель <a href=\"/Nb/4861\" target=\"_blank\">HP Pavilion 13-bb0000</a> стоимостью 52.7 тыс. руб. в среднем.</p>\r\n\r\n<h3>Ноутбуки 13&quot;: Top-10, в августе `21</h3>\r\n\r\n<p><em>Сортировка по убыванию цены</em></p>\r\n\r\n<div class=\"inarticle_table_wrap_outer\">\r\n<div class=\"inarticle_table_wrap\">\r\n<table class=\"inarticle_table\">\r\n	<thead>\r\n		<tr>\r\n			<th>Название</th>\r\n			<th>Цена</th>\r\n			<th>Произв проц.</th>\r\n			<th>Поколение процессора</th>\r\n			<th>Позиционирование</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<th><a href=\"/Nb/3681\">HP ProBook 430 G7</a></th>\r\n			<td>63&nbsp;562</td>\r\n			<td>Intel</td>\r\n			<td>Comet Lake</td>\r\n			<td>Коммерческий</td>\r\n		</tr>\r\n		<tr class=\"tr-top\">\r\n			<th><a href=\"/Nb/4865\">HP ProBook 430 G8</a></th>\r\n			<td>64&nbsp;293</td>\r\n			<td>Intel</td>\r\n			<td>Tiger Lake</td>\r\n			<td>Коммерческий</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4805\">Asus Zenbook UX325E</a></th>\r\n			<td>70&nbsp;535</td>\r\n			<td>Intel</td>\r\n			<td>Tiger Lake</td>\r\n			<td>Потребительский</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4937\">Dell Latitude 5320</a></th>\r\n			<td>83&nbsp;450</td>\r\n			<td>Intel</td>\r\n			<td>Tiger Lake</td>\r\n			<td>Коммерческий</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4708\">Huawei Matebook X EUL</a></th>\r\n			<td>97&nbsp;492</td>\r\n			<td>Intel</td>\r\n			<td>Comet Lake</td>\r\n			<td>Потребительский</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/5059\">HP EliteBook 830 G8</a></th>\r\n			<td>110&nbsp;249</td>\r\n			<td>Intel</td>\r\n			<td>Tiger Lake</td>\r\n			<td>Коммерческий</td>\r\n		</tr>\r\n		<tr class=\"tr-top\">\r\n			<th><a href=\"/Nb/4787\">♔ Apple Macbook Air 13 2020 (M1)</a></th>\r\n			<td>130&nbsp;670</td>\r\n			<td>Apple</td>\r\n			<td>Apple M1</td>\r\n			<td>Потребительский</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/2845\">Apple Macbook Air 13 (IL)</a></th>\r\n			<td>143&nbsp;759</td>\r\n			<td>Intel</td>\r\n			<td>Ice Lake</td>\r\n			<td>Потребительский</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4788\">Apple Macbook Pro 13 2020 (M1)</a></th>\r\n			<td>157&nbsp;428</td>\r\n			<td>Apple</td>\r\n			<td>Apple M1</td>\r\n			<td>Потребительский</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/2849\">Apple Macbook Pro 13 (IL)</a></th>\r\n			<td>219&nbsp;474</td>\r\n			<td>Intel</td>\r\n			<td>Ice Lake</td>\r\n			<td>Потребительский</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n\r\n<p><strong><a href=\"/Nb/?13inch=Yes&amp;tabs=marketability\">Полный рейтинг Top-20 популярных ноутбуков типа <em>&quot;Форм-фактор&quot;: &quot;Ультракомпактный 13&quot;&quot;</em> ⋙</a></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1>Рейтинг ультрабуков-трансформеров 2-in-1 с экраном 13&quot;. Август` 21</h1>\r\n\r\n<div class=\"inarticle_cit1\">\r\n<p>На рынке много 13-дюймовых моделей трансформеров 2-в-1 c поворотным экраном. С учетом того, что 13&quot; - выездной формат ноутбука,&nbsp;режим планшета придется здесь весьма кстати. Более того, такой ноутбук-трансформер можно понимать и как профессиональный планшет для творческих работников, скажем в плане рисования эскизов от руки.</p>\r\n\r\n<p>Поэтому модели-трансформеры именно в этом типоразмере занимают весомую часть ассортимента.</p>\r\n</div>\r\n\r\n<p>В августе 2021 г. лидером продаж в сегменте ноутбуков <em>&quot;Форм-фактор&quot;: &quot;Трансформер с поворотным экраном&quot;; &quot;Ультракомпактный 13&quot;&quot;</em> стала модель <strong><a href=\"/Nb/4945\" target=\"_blank\">HP Spectre x360 14-ea0000</a>&nbsp;</strong>имеющая&nbsp;сертификацию<strong> <a href=\"/how/Nb/4\" target=\"_blank\">Intel EVO</a></strong>.</p>\r\n\r\n<p><img alt=\"HP Spectre x360 14-ea0\" src=\"/static/marketability/pict/rate/Nb/hp_spectre_x360_14-ea0.jpg\" style=\"width: 300px; height: 234px;\" /></p>\r\n\r\n<p>Самым же недорогим устройством данного класса является модель <a href=\"/Nb/4695\" target=\"_blank\">HP ProBook x360 435 G7</a> стоимостью 67.3 тыс. руб. в среднем.</p>\r\n\r\n<h3>Ноутбуки класса 13 2-in-1: Top-5, в августе `21</h3>\r\n\r\n<p><em>Сортировка по убыванию цены</em></p>\r\n\r\n<div class=\"inarticle_table_wrap_outer\">\r\n<div class=\"inarticle_table_wrap\">\r\n<table class=\"inarticle_table\">\r\n	<thead>\r\n		<tr>\r\n			<th>Название</th>\r\n			<th>Цена</th>\r\n			<th>Произв проц.</th>\r\n			<th>Поколение процессора</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<th><a href=\"/Nb/3969\">Lenovo ThinkPad L13 Yoga</a></th>\r\n			<td>84&nbsp;760</td>\r\n			<td>Intel</td>\r\n			<td>Comet Lake</td>\r\n		</tr>\r\n		<tr class=\"tr-top\">\r\n			<th><a href=\"/Nb/4945\">♔ HP Spectre x360 14-ea0000</a></th>\r\n			<td>125&nbsp;574</td>\r\n			<td>Intel</td>\r\n			<td>Tiger Lake</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4998\">HP Elite Dragonfly G2</a></th>\r\n			<td>131&nbsp;668</td>\r\n			<td>Intel</td>\r\n			<td>Tiger Lake</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/4681\">HP EliteBook x360 1030 G7</a></th>\r\n			<td>133&nbsp;136</td>\r\n			<td>Intel</td>\r\n			<td>Comet Lake</td>\r\n		</tr>\r\n		<tr>\r\n			<th><a href=\"/Nb/5094\">HP EliteBook x360 1030 G8</a></th>\r\n			<td>172&nbsp;233</td>\r\n			<td>Intel</td>\r\n			<td>Tiger Lake</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n\r\n<p><strong><a href=\"/Nb/?2_in_1=Yes&amp;13inch=Yes&amp;tabs=marketability\">Полный рейтинг Top-20 популярных ноутбуков типа <em>&quot;Форм-фактор&quot;: &quot;Трансформер с поворотным экраном&quot;</em> ⋙</a></strong></p>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/.../?tabs=marketability\">Выбрать монитор для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/../?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/../?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n</div>\r\n\r\n<div>\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Nb/?13inch=Yes&amp;tabs=marketability\">Top-20 13&quot; Все</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Nb/?13inch=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Nb/?13inch=Yes&amp;tabs=marketability\">Ультракомпактный 13&quot; </a></div>\r\n</div>\r\n</div>\r\n\r\n<div>\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Nb/?2_in_1=Yes&amp;13inch=Yes&amp;tabs=marketability\">Top-20 13 2-in-1</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Nb/?2_in_1=Yes&amp;13inch=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Nb/?2_in_1=Yes&amp;13inch=Yes&amp;tabs=marketability\">Трансформер с поворотным экраном </a></div>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Nb/?2_in_1=Yes&amp;13inch=Yes&amp;tabs=marketa